import Button from "./components/Button";
import {BrowserRouter as Router,
Routes,
Route,
Link
} from "react-router-dom";

import { Home } from './pages/home'
import { Login } from './pages/login'

function App() {
  return (

    <Router>
      <h1>Hello Word!</h1>
      <Routes>
        <Route path="/">
          <Home />
        </Route>

        <Route path="/">
          <Login />
        </Route>

      </Routes>
      </Router>
  );
}

export default App;
